import Navbar from './../components/navbar/navbar'
import { createGlobalStyle } from 'styled-components'


const GlobalSTyle  = createGlobalStyle`

* {
    padding:0;
    margin:0;
    font-family:arial;
}

html {
    width:100%;
    height:100vh;
}

`


export default function Index(){
    return (
        <GlobalSTyle>
            <Navbar></Navbar>

        </GlobalSTyle>
    )
}
